import React from 'react';
import styeld from 'styled-components';

const FormContainer = styeld.div`
  display: flex;
  justify-content: center;
`;

const Form = styeld.form`

`;

const Input = styled.input`

`;

const IntroduceEditForm = () => {
  return (
    <FormContainer>
      <Form>
        <input type="text" />
      </Form>
    </FormContainer>
  );
};

export default IntroduceEditForm;
